<script>
window.onload = function(){
var output = document.getElementById("output"), out = "";
var cluster = [], queue = [];

runTest("Empty Function", empty);
runTest("Empty Loop", simple);
runTest("Div Loop", medium);
runTest("Div Modify", complex);

var interval = setInterval(function(){
	if ( queue.length ) {
		queue.shift()();
	} else {
		for ( var i = 0; i < cluster.length; i++ ) {
			out += "," + (cluster[i] || 0);
		}
		output.innerHTML = out;

		clearInterval( interval );
	}
}, 10);

function runTest(name, fn){
	for ( var i = 0; i < 100; i++ ) {
		queue.push(function(){
			window.external.startBench();
			fn();
			var end = window.external.stopBench();
			cluster[end] = (cluster[end] || 0) + 1;
		});
	}
}

function empty(){}

function simple(){
	for ( var i = 0; i < 10000; i++){}
}

function medium(){
	var divs = document.getElementsByTagName("div");
	for ( var i = 0; i < divs.length; i++ ){}
}

function complex(){
	var divs = document.getElementsByTagName("div");
	for ( var i = 0; i < divs.length; i++ ){
		if ( divs[i].firstChild ) {
			divs[i].className = "test";
		}
	}
}
};
